import React from "react";
import ReactDOM from "react-dom/client";

const root = ReactDOM.createRoot(document.getElementById("root"));

function Card(props) {
  return (
    <>
      <h1>{props.name}</h1>
      <img src="https://images.pexels.com/photos/3473516/pexels-photo-3473516.jpeg?cs=srgb&dl=pexels-elijah-o%27donnell-3473516.jpg&fm=jpg" />
      <p>9819067819</p>
      <p>sushandahal0@gmail.com</p>
    </>
  );
}

root.render(
  <>
    <Card
      name="Sushant Dahal"
      img="https://images.pexels.com/photos/3473516/pexels-photo-3473516.jpeg?cs=srgb&dl=pexels-elijah-o%27donnell-3473516.jpg&fm=jpg"
    />
  </>
);
